import React from 'react';
import Card from './card';
const cardList=({ robots })=>{

    return(
        <div>
        <Card id={ robots[1].id } email={ robots[2].email } name={ robots[3].name  } username={ robots[1].username } key="1" />
        </div>
    )

}
export default cardList;
